import React from 'react';
import * as BsIcons from 'react-icons/bs';

// Criando componentes funcionais que renderizam os ícones diretamente
const IconWrapper = ({ icon: Icon, ...props }) => <Icon {...props} />;

export const SearchIcon = (props) => <IconWrapper icon={BsIcons.BsSearch} {...props} />;
export const ChartIcon = (props) => <IconWrapper icon={BsIcons.BsBarChart} {...props} />;
export const GearIcon = (props) => <IconWrapper icon={BsIcons.BsGear} {...props} />;
export const FileIcon = (props) => <IconWrapper icon={BsIcons.BsFileText} {...props} />;
export const FilterIcon = (props) => <IconWrapper icon={BsIcons.BsFilter} {...props} />;
export const SaveIcon = (props) => <IconWrapper icon={BsIcons.BsSave} {...props} />;
export const TrashIcon = (props) => <IconWrapper icon={BsIcons.BsTrash} {...props} />;
